import { Fragment } from "react";



const App = () => {

  const arak = [
    ["Halberd", "400gp"],
    ["Brass armor", "150gp"]   
  ]

  return (
    <section 
      style={{
      display: "flex",
      width: "100vw",
      height: "100vh",
      justifyContent: "center",
      alignItems: "center"
    }}>
      <button>Arak</button>
      <button>Osaris</button>
      <button>Garrogat</button>

      <ul>
      {arak.map((item, i) => {
        return (
          <div>
            <li>{item}</li>
            
          </div>
        )
      })}
      </ul>
    </section>
  )
}

export default App;
